extra.raw:
"<div class="row">
  {% util.eachComponent(components, function(component) {
    if (component.key === 'loadTypeFundCode') { %}
      <div class="col-sm-2">
        <strong>Fund Code</strong>
      </div>
      <div class="col-sm-2">
        <strong>Load Type</strong>
      </div>    
    {% } else if (component.key !== 'fundClass') { 
      if (component.key === 'fundName2') { %}
      <div class="col-sm-2">
      {% } else { %}
      <div class="col-sm-2">
      {% } %}
      <strong>{{ component.label }}</strong>
      </div>
      {% }
  }) %}
</div>"

"<div class="row">
  {% console.dir(row);
  util.eachComponent(components, function(component) { 
    if (component.key === 'loadTypeFundCode') { 
      var fundCode = '';
      var loadType = '';
      var item = component.data.values.find(item=>item.value==row[component.key]);
      if (!!item) {
	      var itemParts = item.label.split('/');
        loadType = itemParts [0];
	      if (itemParts.length > 1) { 
	        fundCode = itemParts [1];
        }
      }
    %}
    <div class="col-sm-2">{{ fundCode }}</div>
    <div class="col-sm-2">{{ loadType }}</div>
    {% } else if (component.key !== 'fundClass') { 
      if (component.key === 'fundName2') { %}
      <div class="col-sm-2">
      {% } else { %}
      <div class="col-sm-2">
      {% } 
      if (!!component.data && !!Array.isArray(component.data.values)) { 
        var item = component.data.values.find(item=>item.value==row[component.key]);
        if (!!item) { %}
          {{item.label}}
        {% } else { %}
          {{ row[component.key] }}
        {% } 
      } else { %}
        {{ row[component.key] }}
      {% } %}
    </div>
    {% }
  }) %}
  <div class="col-sm-2">
    <div class="btn-group pull-right">
      {% if (!instance.hasOpenRows()) { %}
      <div class="btn btn-default btn-sm editRow"><i class="fa fa-edit"></i></div>
      <div class="btn btn-danger btn-sm removeRow"><i class="fa fa-trash"></i></div>
      {% } %}
    </div>
  </div>
</div>"

